import React from "react";
import { ListGroup, Tab, Tabs } from "react-bootstrap";

function Coach({ data }) {
  return (
    <div>
      <h2>Leage Admin Page</h2>
      <Tabs defaultActiveKey="home" id="admin-tabs" className="mb-3">
        <Tab eventKey="home" title="Home">
          <h3>Home Page</h3>
        </Tab>
        <Tab eventKey="player" title="Players">
          <PlayersInfo data={data}></PlayersInfo>
        </Tab>
      </Tabs>
    </div>
  );
}

function CoachData({ data }) {
  return (
    <ListGroup className="player-info-container">
      <h3>Your Details Below</h3>
      <ListGroup.Item variant="dark">Name:{data.name}</ListGroup.Item>
      <ListGroup.Item variant="light">Team Name:{data.team}</ListGroup.Item>
      <ListGroup.Item variant="dark">
        Your Average Score:{data.average_score}
      </ListGroup.Item>
      <ListGroup.Item variant="light">
        Number of games played:{data.games_participated}
      </ListGroup.Item>
    </ListGroup>
  );
}

export default Coach;
